import Phaser from "phaser";
import wintel from '../../assets/wintel.png';
import sword from '../../assets/sword.png';
import gun from '../../assets/gun.png';
import bullet from '../../assets/bullet.png';
import zombie from '../../assets/damaged_wintel.png';
import slash from '../../assets/slash.png';
import Player from '../objects/Player'
import Weapon from '../objects/Weapon'
import Enemy from "../objects/Enemy";

export class Game extends Phaser.Scene {
  constructor() {
    super({ key: 'Game' })
  }

  preload() {
    this.load.image('player', wintel)
    this.load.image('sword', sword)
    this.load.image('gun', gun)
    this.load.image('bullet', bullet)
    this.load.image('enemy', zombie)
    this.load.image('slash', slash)
  }

  create() {
    // Crear el jugador
    this.player = new Player(this, 400, 300)

    // Crear el arma
    this.weapon = new Weapon(this, this.player)

    // Crear un grupo de enemigos
    this.enemies = this.physics.add.group({
        classType: Enemy,
        runChildUpdate: true
    })
  
    // Crear algunos enemigos
    this.enemies.add(new Enemy(this, 500, 300))
    this.enemies.add(new Enemy(this, 600, 400))

    // Definir las teclas de entrada
    this.cursors = this.input.keyboard.createCursorKeys()
    this.attackKey = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.SPACE)
    this.switchWeaponKey = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.Q)

    // Registrar colisiones entre las balas y los enemigos
    this.physics.add.overlap(this.weapon.bullets, this.enemies, this.bulletHitEnemy, null, this)

    // Configurar colisiones entre el slash de la espada y los enemigos
    this.physics.add.overlap(this.weapon.swordSlashes, this.enemies, this.slashHitEnemy, null, this)

    // Configurar colisiones entre los enemigos y el jugador
    this.physics.add.overlap(this.enemies, this.player, this.enemyHitPlayer, null, this)
  }

  update() {
    // Actualizar el jugador y el arma
    this.player.update(this.cursors)
    this.weapon.updateWeaponPosition()

    // Cambiar de arma
    if (Phaser.Input.Keyboard.JustDown(this.switchWeaponKey)) {
      this.weapon.switchWeapon()
    }

    // Ataque
    if (Phaser.Input.Keyboard.JustDown(this.attackKey)) {
      this.weapon.attack(this.enemies)
    }
  }

  // Función llamada cuando una bala impacta con un enemigo
  bulletHitEnemy(bullet, enemy) {
    enemy.takeDamage(5) // El enemigo recibe daño
    bullet.destroy() // La bala se destruye al impactar
  }

  // Función llamada cuando el slash impacta con un enemigo
  slashHitEnemy(slash, enemy) {
  enemy.takeDamage(10) // El enemigo recibe daño por el slash
  slash.destroy() // Destruir el slash después de impactar
  }

  // Función llamada cuando un enemigo impacta con el jugador
  enemyHitPlayer(player, enemy) {
    player.takeDamage(10) // El jugador recibe daño
    enemy.destroy() // El enemigo se destruye al impactar con el jugador
  }

}
